import React from 'react';

const aTags = ['Home', 'Bio', 'Gallery'];
const liStyle = {
  float: 'left',
  color: 'white',
  textAlign: 'center',
  padding: '14px 16px',
  textDecoration: 'none',
  fontSize: '17px',
  listStyleType: 'none'
};

const listItems = aTags.map((item, index) => 
    <li key={index}
        style={liStyle}>
        <a href={item}
        style={{color: 'white'}}>{item}</a>
    </li>
);

const ulStyle = {
  backgroundColor: '#333',
  overflow: 'hidden',
  width: '100%'
};

export class Header extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            aTags: ['Home', 'Bio', 'Gallery'],
            date: new Date()
        }
    }

    render() {
        return <div>
            <ul style={ulStyle}> 
              {listItems} 
            </ul>
            <h1>下記に載っているコンテンツをご覧ください</h1>
        </div>
    }
}
